import GridIcon from "@heroicons/react/solid/ViewGridIcon";
import { FaSignInAlt, FaSignOutAlt, FaUser } from "react-icons";
import { Link } from "react-router-dom";
function Header() {
  const links = [
    {
      name: "Login",
    },
  ];

  return (
    <header className="">
      <div>
        <Link to="/">Taskerr</Link>
      </div>
      <ul>
        {links.map((link, idx) => (
          <li>link.name</li>
        ))}
      </ul>
    </header>
  );
}

export default Header;
